// components/Accueil.js
import React from 'react';

const Accueil = () => {
  return (
    <div>
      <h2>Bienvenue sur mon portfolio</h2>
      <li className="p-3 border rounded-md">
        <p className="text-lg font-semibold mb-5">Loupe pas ton quizz</p>
        <p className="text-lg font-semibold mb-5">Jeu des allumettes</p>
        <p className="text-lg font-semibold mb-5">Break the code</p>
      </li>
    </div>
  );
}

export default Accueil;
